import React from 'react'
import Navbar from '../components/navbar/navbar'
import Sidebar from '../components/sidebar/sidebar'
import Singleview from '../components/singleview/singleview'

const sidebar_options = {
    marginTop: {
        marginTop: "2vh"
    },
    blank: false,
    blocks: {
        item1: {
            title: "Add Movie",
            link: "/createMovie"
        },
        item2: {
            title: "List View",
            link: "/listview"
        },
        item3: {
            title: "Multi View",
            link: "/multiview"
        },
        item4: {
            title: "Single View",
            link: "/singleview"
        }
    }
}

axios({
    method: "Get",
    url: "/movies/Shawshank"
})
.then(result => {
    console.log(result)
})

const SingleView = (props) => {
    return(
        <div>
            <Navbar />
            <Sidebar input={sidebar_options}/>
            <Singleview  />
        </div>
    )
}

export default SingleView
